SELECT N.oid AS ID, N.nspname AS nome_schema, C.relname AS nome_tabella, C.relpages AS numero_pagine, C.reltuples AS numero_tuple, C.relhasindex AS contiene_indici, C.relkind AS tabella_o_indice
FROM pg_namespace N JOIN pg_class C ON N.oid = C.relnamespace
WHERE  N.nspname = 'unige_social_sport' AND relname IN ('cl_utenti','cl_iscrizioni');